import React, { Component } from "react";

class User extends Component {

  renderUsers = () => {
    return this.props.users.map(user => <div>{user.name}</div>)
  }

  render() {
    return (
      <div className='left-nav'>
        {this.renderUsers}
      </div>
    );
  };

}

export default User;
